BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `pricequotation_item` (
	`id`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`name`	varchar ( 200 ) NOT NULL UNIQUE,
	`description`	varchar ( 200 ) NOT NULL,
	`salesprice`	decimal NOT NULL,
	`unitofmeasure_id`	integer,
	`unitofpackage_id`	integer,
	`isactive`	bool NOT NULL,
	`fullname`	varchar ( 200 ) UNIQUE,
	`productcode`	varchar ( 200 ),
	`group_id`	integer,
	`category_id`	integer,
	`remark`	varchar ( 200 ),
	`QuickbookListID`	varchar ( 200 ) UNIQUE,
	FOREIGN KEY(`unitofmeasure_id`) REFERENCES `pricequotation_unitofmeasure`(`id`) DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY(`category_id`) REFERENCES `pricequotation_category`(`id`) DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY(`group_id`) REFERENCES `pricequotation_group`(`id`) DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY(`unitofpackage_id`) REFERENCES `pricequotation_unitofpackage`(`id`) DEFERRABLE INITIALLY DEFERRED
);
